import RowTable from "../components#/row-table.vue";
import { columns } from "./verification.config";
import { RowTableService } from "../components#/row-table.service";
import tableMixin from '@/mixins/table.mixin';
export default {
  name: 'verification',
  components: {
    RowTable: RowTable
  },
  mixins: [tableMixin],
  computed: {
    columns: columns
  },
  serviceInject: function serviceInject() {
    return {
      rowTableService: RowTableService
    };
  },
  methods: {
    // 核销订单
    confirm: function confirm(val) {
      var _this = this;

      this.rowTableService.verificationGood({
        id: val.id
      }).subscribe(function (res) {
        _this.getListData();
      });
    },
    // 获取核销订单列表
    getListData: function getListData(page) {
      if (page === 1) {
        this.$searchQuery.current_page = page;
      }

      this.rowTableService.getList(this.$searchQuery).subscribe();
    }
  },
  mounted: function mounted() {
    this.getListData();
  }
};
